node.text:
Dancing on the edge of the infinite. First or second one? The first took multiple layers of editing while the second was barely edited out of camera. I love both. I just like making things feel dreamy🥰

@piersonx and I were freaking out this whole shoot. The backyard went from white out to golden mist to these surreal conditions all in a few minutes.

Cape Town has such extreme weather. It was hailing this morning and warm enough to wear shorts this afternoon - but it makes for some really beautiful cloud/inversion conditions.🤍☁️
